import { GET_MOVIE_LOADING } from '../action_constant';


const initialState = {
    loading: false,
};

export default function animeReducer(state = initialState, action) {
    switch (action.type) {
        case GET_MOVIE_LOADING:
            return { ...state };
        default:
            return state;
    }
}
